import { DiscoverWrapper, TopMenu } from "./style";

export default memo(function LJDiscover() {
  return (
    <DiscoverWrapper>
      <div className="top">
        <TopMenu className="topMeun"></TopMenu>
      </div>
    </DiscoverWrapper>
  );
});
